import React, { useEffect, useState } from 'react'
import './Home.css'
import ProductCard from '../../components/ProductCard'
function Home() {
  const [tarifler,setTarifler]= useState(null)

  useEffect(()=>{
     fetch("http://localhost:3000/tarifler").then(res=>res.json()).then(data=>setTarifler(data))
  },[])
  return (
    <div className='row mt-3'>
      {tarifler &&  tarifler.map(tarif=>(
       <div className="col-3 mb-3">
        <div className="card">
        <img src={`img/${tarif.resim}`} alt={tarif.baslik} />
        </div>
       </div>
      ))}
    </div>
  )
}

export default Home
